import Header from "../../components/header";
import Head from "../../components/head";
import './Sass/notif.scss';
import NotifCard from "./Components/NotifCard";
import NotifBell from "../../components/svg/NotifBell";
import { NULL } from "node-sass";
const Notification = ()=>{
    
    const Profile = {
        Notification : [{
            Message : 'Cognitis enim pilatorum caesorumque funeribus nemo deinde ad has stationes appulit navem, sed ut Scironis praerupta letalia declinantes litoribus Cypriis contigui navigabant, quae Isauriae scopulis sunt controversa.',
            SenderId : 154896448344 ,
            Horraire : '08:00-11:00',
            AcceptStatus : null
            } , 
            {
                Message : 'There is no CSS for applying an underline ( text-decoration: underline; ) only to individual words in a multiple-word element. The best way would be to wrap each word in a span (not the spaces, just the words) in spans and apply underline to those spans',
                SenderId : 154896448574 ,
                Horraire : '14:00-15:00',
                AcceptStatus : null
            }, 
            {
                Message : 'Ego vero sic intellego, Patres conscripti, nos hoc tempore in provinciis decernendis perpetuae pacis habere oportere rationem. Nam quis hoc non sentit omnia alia esse nobis vacua ab omni periculo atque etiam suspicione belli?',
                SenderId : 154896448574 ,
                Horraire : '14:00-15:00',
                AcceptStatus : null
            }]
    }
    return(
        <div className="body">
            <Header/>
            <Head title="Notifications | 6Solutions"/>
            <div className="NotifBody">
                <div className="NotTitle">
                    <span className="icon-button"><NotifBell/></span>
                    <h1 className="NotifHeader">Notifications</h1>
                </div>
                
                <p className="Warning">La réunion sera automatiquement annulée si aucune réponse n’a été donnée ( 1h avant la réunion au plus tard)</p>
                <div className="NotifContainer">
                    {Profile.Notification.map(notif => <NotifCard notif={notif}/>)}    
                </div>
            </div>
            
        </div>
    )
}
export default Notification
